import React from "react";

function RegionFilterPrisintation({
  darkMode,
  filterOptions,
  handaleChange,
  filterLabel,
}) {
  // Return Elements:
  return (
    <select
      className={`form-select ${darkMode ? "spic-dark-mode" : "light"}`}
      aria-label="Default select example"
      onChange={handaleChange}
      name="region"
    >
      <option value={"noValue"} hidden>
        {filterLabel}
      </option>
      {filterOptions.map((choise, index) => (
        <option key={index} value={choise}>
          {choise === "noValue"
            ? "No Filter"
            : choise === "fav"
            ? "Faviorits"
            : choise}
        </option>
      ))}
    </select>
  );
}

export default RegionFilterPrisintation;
